var $ = jQuery.noConflict();
jQuery(function() {
	isElementExist(".scroll-link", myScrollLink);
});

//-------- -------- -------- --------
//-------- js custom start
//-------- -------- -------- --------

// Helper if element exist then call function
function isElementExist(_el, _cb) {
	var elem = document.querySelector(_el);

	if (document.body.contains(elem)) {
		try {
			_cb();
		} catch(e) {
			console.log(e);
		}
	}
}


// Helper ScrollLink function init
function myScrollLink() {
	var $root = $("html, body");
	$(".scroll-link").on("click", 'a[href^="#"]', function (event) {
		event.preventDefault();
		$root.animate(
			{
				scrollTop:
					$($.attr(this, "href")).offset().top -
					$(".page-header").outerHeight(),
			},
			700
		);
		return false;
	});
}

//-------- -------- -------- --------
//-------- js custom end
//-------- -------- -------- --------

//-------- -------- -------- --------
//-------- included js libs start
//-------- -------- -------- --------

/* module flatpickr */
jQuery(function() {
	isElementExist(".flatpickr", flatpickrInit);
});

function flatpickrInit() {
	$(".flatpickr").flatpickr({
		enableTime: true,
		minDate: "today",
		disableMobile: true,
		dateFormat: "D, m/d h:i K",
	});
}

