// function on
jQuery(function() {
	isElementExist(".colorThiefimg", colorThiefInit);
});
// function init - see https://lokeshdhakar.com/projects/color-thief/
function colorThiefInit() {
	const colorThief = new ColorThief();
	const img = document.querySelector('.colorThiefimg');

	const rgbToHex = (r, g, b) => '#' + [r, g, b].map(x => {
		const hex = x.toString(16)
		return hex.length === 1 ? '0' + hex : hex
	}).join('')
	//  how to use
	// rgbToHex(102, 51, 153);

	let colorThiefimgDominant = colorThief.getColor(img);
	let colorThiefimgPalette = colorThief.getPalette(img);
	$('.colorThiefimgDominant').append('<span style="--colorThiefimgPalette:' + rgbToHex(...colorThiefimgDominant) + '">' + rgbToHex(...colorThiefimgDominant) + '</span> --- ')
	colorThiefimgPalette.forEach(element => {
		$('.colorThiefimgPalette').append('<span style="--colorThiefimgPalette:' + rgbToHex(...element) + '">' + rgbToHex(...element) + '</span> --- ')
	});
}

