/* module swiper */
// function on
jQuery(function() {
	isElementExist(".my-swiper1", swiperInit);
	isElementExist(".my-swiper-destroy", swiperDestroyInit);
});
// function init
function swiperInit() {
	const swiper = new Swiper(".my-swiper1", {
		grabCursor: true,
		effect: "cards",
		loop: true,
		// Navigation arrows
		navigation: {
			nextEl: ".swiper-button-next-s1",
			prevEl: ".swiper-button-prev-s1",
		},
	});

	var swiper2 = new Swiper(".my-swiper2", {
		grabCursor: true,
		effect: "creative",
		creativeEffect: {
			prev: {
				shadow: true,
				translate: ["-125%", 0, -800],
				rotate: [0, 0, -90],
			},
			next: {
				shadow: true,
				translate: ["125%", 0, -800],
				rotate: [0, 0, 90],
			},
		},
		// Navigation arrows
		navigation: {
			nextEl: ".swiper-button-next-s2",
			prevEl: ".swiper-button-prev-s2",
		},
	});
}

function swiperDestroyInit() {
	// breakpoint where swiper will be destroyed
	// and switches to a dual-column layout
	const breakpoint = window.matchMedia("(max-width:768px)");

	// keep track of swiper instances to destroy later
	let mySwiper;

	const breakpointChecker = function () {
		// if larger viewport and multi-row layout needed
		if (breakpoint.matches === true) {
			// clean up old instances and inline styles when available
			if (mySwiper !== undefined) mySwiper.destroy(true, true);

			// or/and do nothing
			return;

			// else if a small viewport and single column layout needed
		} else if (breakpoint.matches === false) {
			// fire small viewport version of swiper
			return enableSwiper();
		}
	};

	const enableSwiper = function () {
		mySwiper = new Swiper(".my-swiper-destroy", {
			loop: true,
			slidesPerView: 3,
			spaceBetween: 30,
			autoplay: {
				delay: 1500,
			},
		});
	};

	// keep an eye on viewport size changes
	breakpoint.addEventListener("change",breakpointChecker);

	// kickstart
	breakpointChecker();
}


